import React from "react";
import {Link} from 'react-router-dom'


class SeasonTab extends React.Component{
  render() {
    return(
      <li className="tab col s3"><Link to={`#test1`}>Season {this.props.Season_Id}</Link></li>
    )
  }
}
export  default SeasonTab
